import '../res/style/App.css';
import ContactForm from "../components/contact/ContactForm";
import ResumeForm from "../components/contact/ResumeForm";

const textFieldStyle = {
    border: '1px #fff solid',
    borderRadius: '0.25em',
    color: '#fff',
}

const submitButtonStyle = {
    color: 'white',
    backgroundColor: 'rgba(45,45,45,0.8)',
    border: '1px transparent solid',
    padding: '0.5em 1em 0.5em 1em',
    'a': {textDecoration: 'none'},
    'a:visited': {
        color: 'white'
    },
    ':hover': {
        color: '#fff',
        backgroundColor: '#68935a',
        border: '1px #98CE86 solid',
    },
}

const Contact = () => {
    return (
        <div className="Body">
            <h1>Feedback and Inquiries</h1>
            <ContactForm />
            <h1>Request Resume</h1>
            <p>If you'd like a copy of my resume, please use this form. I will send you a copy as soon as possible. </p>
            <ResumeForm />
        </div>
    );
}

export default Contact;
